INSERT INTO hmhub.tb_joke (id, customer_id, title, img, create_time, update_time) VALUES (434, '5e6838496e36d06bc24aa554', '【#泉州酒店搜救犬贝贝四肢感染# 曾15分钟就找到被困人员】泉州酒店坍塌救援现场有一只名叫“贝贝”的搜救犬，今年已经6岁半了，它从小就是由消防队员易文斌带大的，他们一起成长，一起训练。在酒店坍塌事故发生的当天晚上，贝贝就来到了现场。在到达15分钟就立即搜索到被困人员。这几天来，贝贝已经连续工作了很久，如今四肢都有受伤感染。现在消防队员易文斌正在为它包扎伤口。', 'https://image.hahamx.cn/2020/03/11/middle/2927254_24d27c4e0e935813bcb3b4a4df5d3e46_1583888214.gif', '2020-03-18 14:59:17', '2020-03-18 14:59:17');
