            #北京战疫# 【京报锐评｜收起你的傲慢无礼，只为所有人的平安】返京后不按规定居家隔离，外出跑步不戴口罩，面对社区防疫人员劝告，不但不听，还大喊“救命”。近日，一段国外返京女子拒不隔离视频引发热议。有知情者透露，该女子为澳大利亚籍华人，是@拜耳中国 公司员工。昨晚，拜耳中国称，公司已按规定对其做出辞退处理。<br />
    “跑步女”被辞退，也许出乎网友意料，其实，正在情理之中。一个对法律毫无敬畏之心、没有遵守之意的人，一个对他人好心劝说置之不理反而耍横撒泼的人，一个只图自己舒服而置他人身体健康和生命安全与不顾的人，是任何一家企业都不希望雇佣的员工。拜耳中国回应及时、处理坚决，体现了一个企业基本的法治意识和社会责任。目前，对不遵守居家隔离规定的居民，大多采取规劝的方式。因为造成恶劣社会影响，公司做出辞退处理，也给那些自行其是的人提了个醒，居家隔离不仅靠自觉，也要随时接受社会监督。傲慢无礼，耍泼耍横，
             <span class=''text-more'' id=''more-2928185'' style="display:none;">只会自食其果。</span>
