            不得不说，在同行的衬托之下，某坤的形象突然高大了起来。我并非什么粉（如果是的话我立马扑街），作为一个艺人经纪在这里客观的谈几个关于被黑出翔的蔡在疫情期间以及争议期间的一些事。<br />
<br />
1.坊间传闻他在疫情期间去韩国避难，韩国出现疫情后又回国，蔡的确是去了韩国，但却是在2月22日回的国，而韩国发现第一例新冠肺炎并发布消息是在2月21日，就算他消息再灵通也不可能预知韩国疫情未来发展会比当时的中国还严重，所以刻意避难说是不成立的。<br />
<br />
2.为疫情捐款是真的，分40万和20万两次捐款，时间是2月3日，捐款方均为新沂蔡徐坤影视文化工作室 ，蔡作为该工作室持股100%的老板、唯一的艺人以及最终受益人这60万等于完全是自己出资，此外又号召粉丝捐了将近58万的物资。<br />
<br />
3.前段日子寄律师函是事实，但不是给B站寄的，而是给B站的某个制作断头视频的视频主寄的，该视频在B站已经下架。此外，这个律师函的自黑炒热度的运营成
             <span class=''text-more'' id=''more-2927452'' style="display:none;">分很大，授意者是不是蔡本人还不知道，但肯定不是运营新手干的。<br />
<br />
4.从始至终的黑点也就是美国校队打篮球，但事实上，他的确在Grace Brethren Lancers的球队打过篮球，只不过这个校队是预备队，并不是美国最高级别的高中联赛。所谓的NBA大使是指粉丝向的新春大使，撑死了算个广告噱头，在NBA火箭队出现问题后，蔡立刻选择解约。<br />
<br />
5.私下表示对《鸡你太美》的各种鬼畜感兴趣，不排除未来也会像吴亦凡那样自黑，但原歌曲的版权不属于他，所以暂时还不敢这么做。<br />
<br />
以上是客观存在的事实，不是洗，不是编，爱不爱听都已经存在，我只是说出来而已，如果您讨厌，我可以先想您道歉，您点个鄙视，权当我放P就行。谢谢！</span>
